import logo from './logo.svg';
import { useState } from 'react';
import './App.css';
import Card from './conponents/Card.js';
import {data} from './conponents/data.js';



function App() {

  let item_data = data.map((items)=>{
    return(
      <Card
           {...items}
      />
    );
  })

  return (
    <div className="App">
    <div>
      <h2></h2>
    </div>
    {/* {item_data} */}
    </div>
  );
}

export default App;
